import React, { useState } from "react";
import Hearts from "react-animated-heart";

function Heart() {
  const [isClick, setClick] = useState(false);
  return (
    <div className="heart">
      <Hearts isClick={isClick} onClick={() => setClick(!isClick)} />
    </div>
  );
}

export default Heart;
